export const getBackgroundColor = function () {
    const uniqueId = arguments.join("");
  const memo = {};
  if (!memo[uniqueId]) {
    memo[uniqueId] = `rgb(${[
      Math.random() * 255,
      Math.random() * 255,
      Math.random() * 255,
    ].toString()})`;
  }
  return memo[uniqueId];
};
